import PropTypes from 'prop-types';

const  Header = (props ) =>{
    return (
        <div>
            <h1 style={{ color:'red',fontSize:'' }} >{props.branding}</h1>
        </div>
    )
}

Header.defaultProps={
    branding:PropTypes.string.isRequired
}

export default Header;
